import React from "react";
import './index.css'
import {
    ThemeProvider,
    Editable,
    EditablePreview,
    EditableInput,
    Input
} from "@chakra-ui/core";
function Index({ children }) {
    return (
        <div className="App">
            <ThemeProvider>
            <Input  placeholder="Basic usage" />
            <Editable className="test" defaultValue="Take some chakra">
                <EditablePreview />
                <EditableInput />
            </Editable>
        <style jsx>
            {`
            .App{
                width: 1100px;
                margin: 0 auto;
            }
            `}
        </style>
        </ThemeProvider>
        </div>
    );
}
// const Index = () => (
